/**
 * 路由组件
 */
import ChatContainer from '../containers/chat'
import Setting from '../containers/setting'
import MailList from '../containers/mail-list'
import Welcome from '../components/welcome'
import ChatMessage from '../containers/chat/message'
import Login from '../containers/login/login'

const Routers = [
    {
        path: '/',
        components: ChatContainer => import('../containers/chat')
    },
    {
        path: '/welcome',
        components: Welcome => import('../components/welcome')
    },
    {
        path: '/message',
        components: ChatMessage => import('../containers/chat/message')
    },
    {
        path: '/mail-list',
        components: MailList
    },
    {
        path: '/setting',
        components: Setting
    },
    {
        path: '/set-message',
        components: Setting
    },
    {
        path: '/set-page',
        components: Setting
    },
    {
        path: '/set-login',
        components: Setting
    },
    {
        path: '/set-about',
        components: Setting
    },
    {
        path: '/login',
        components: Login
    }
]

export default Routers
